import React from 'react';

const Provinces = () => {

    const [province, setProvince] = useState({
        provinces: ['Alberta', 'Colombie-Britannique', 'Ile- du-Prince-Édouard', 'Manitoba', 'Nouveau-Brunswick', 'Nouvelle- Écosse', 'Ontario', 'Québec', 'Saskatchewan', 'Terre-Neuve-et-La- brador', 'Nunavut', 'Territoires du Nord\'Ouest', 'Yukon'],
        strFiltre: '',
        binTrouve: false
        });

    return (
        <div>
            <ul>
                {this.state.provinces.map(currProvince => { return (
                <li key={currProvince}>
                    {currProvince}
                </li>
                );
            })}
            </ul>
        </div>
    );
};

export default Provinces;
